import React, { useEffect, useState } from 'react';
import {
  Box, Flex, HStack, IconButton, useDisclosure, Stack, Input, Text, Image, Button, PopoverFooter, PopoverBody, PopoverHeader, PopoverCloseButton, PopoverArrow, PopoverContent, Popover, PopoverTrigger, Heading, Modal, ModalBody, ModalCloseButton, ModalContent, ModalFooter, ModalOverlay, Spinner, useToast,
} from "@chakra-ui/react";
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { getItem, setItem } from '../../utility/localStorage';
import { AddUser } from '../../redux/Authentication/auth.action';

const UserLogin = ({ handlechenge, Registarion, handleLogin, setRegistarion, setConform, cred, conform, handleLogout, admin }) => {
  const { isOpen, onOpen, onClose } = useDisclosure();
  const { isLoading, isError, userData, isAuth, userlist, adminlist } = useSelector((store) => store.auth);
  let tocken = getItem("userData");

  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const dispatch = useDispatch();
  const toast = useToast();

  async function signUp() {
    let item = { name, password, email };
    console.warn(item);

    try {
      let result = await fetch("http://localhost:8000/api/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Accept: 'application/json'
        },
        body: JSON.stringify(item)
      });
      result = await result.json();
      console.warn("result", result);
    } catch (error) {
      // Handle error
    }
  }

  useEffect(() => {
    // Handle authentication and registration responses
  }, [userData, dispatch]);

  return (
    <>
      {tocken === null ? (
        <Button
          onClick={onOpen}
          fontSize={{ base: "12px", md: "14px" }}
          fontFamily="arial"
          background="-webkit-gradient(linear,left top,left bottom,from(#058b80),to(#02625a))"
          colorScheme="#fff"
          size="md"
          p="5px 40px"
        >
          Login/Sign Up
        </Button>
      ) : (
        <Button
          onClick={handleLogout}
          fontSize={{ base: "12px", md: "14px" }}
          fontFamily="arial"
          background="-webkit-gradient(linear,left top,left bottom,from(#058b80),to(#02625a))"
          colorScheme="#fff"
          size="md"
          p="5px 40px"
        >
          Logout
        </Button>
      )}

      {!admin && (
        <Modal
          closeOnOverlayClick={false}
          isOpen={isOpen}
          onClose={onClose}
        >
          <ModalOverlay />
          <ModalContent>
            <ModalCloseButton />
            <ModalBody textAlign={"center"} pb={6}>
            {!Registarion && (
  // Login Form
  <></> // Placeholder for the login form JSX
)}

              {Registarion && (
                // Registration Form
                <Flex flexDirection={"column"} gap={2}>
                  <Heading color={"#333"}>Registration</Heading>
                  <Input
                    placeholder="Name..."
                    name="name"
                    onChange={(e) => setName(e.target.value)}
                  />
                  <Input
                    placeholder="Email..."
                    name="email"
                    onChange={(e) => setEmail(e.target.value)}
                  />
                  <Input
                    placeholder="Password..."
                    type="password"
                    name="password"
                    onChange={(e) => setPassword(e.target.value)}
                  />
                  <Button
                    onClick={signUp}
                    fontFamily="arial"
                    background="-webkit-gradient(linear,left top,left bottom,from(#058b80),to(#02625a))"
                    colorScheme="#fff"
                    mr={3}
                  >
                    {isLoading ? <Spinner /> : "Sign Up"}{" "}
                  </Button>
                  <Link onClick={() => setRegistarion(!Registarion)}>
                    Already have an account
                  </Link>
                </Flex>
              )}
            </ModalBody>
          </ModalContent>
        </Modal>
      )}
    </>
  );
};

export default UserLogin;
